import Header from "./Header";
import Content from "./Content";
import Footer from "./Footer";
import {useState} from "react";

function App() {

    const [items, setItems] = useState([
        {
            id: 1,
            checked: true,
            item: "One half pound bag of Cocoa Covered Almonds Unsalted"
        },
        {
            id: 2,
            checked: false,
            item: "Item 2"
        },
        {
            id: 3,
            checked: false,
            item: "Item 3"
        }
    ]);

   return (
      <div className="App">
          <Header
              title={"Groceries"}
          />
          <Content
          items={items}/>
          <Footer />
      </div>

  );
}

export default App;
